import React, {useEffect,useState} from 'react';
//import axios from 'axios';
import Box from '@mui/material/Box';
import Grid from '@mui/material/Grid';
import {  Button, TextField, makeStyles, FormControlLabel, Checkbox, FormControl, FormLabel, FormGroup  } from '@material-ui/core';
import {Edit, Delete} from '@material-ui/icons';
import { Contenedor } from "../../Components";

const useStyles = makeStyles((theme)=>({
  modal:{
      position: 'absolute',
      width: 400,
      backgroundColor: theme.palette.background.paper,
      border: '2px solid #000',
      boxShadow: theme.shadows[5],
      padding: theme.spacing(2,4,3),
      top: '50%',
      left:'50%',
      transform: 'translate(-50%, -50%)'
  },
  icons: {
      cursor: 'pointer'
  },
  inputMaterial:{
      width: '100%'
  },
  button:{
      width: '20%',
      //margin: theme.spacing(10,65,10),
      marginTop: theme.spacing(8) ,
      
      [theme.breakpoints.down(400 + theme.spacing(2)+2)]:{
          margin: theme.spacing(0),
          width: '100%',
          height: '100%'
      }
  },
  text2:{
    textAlign : 'left',
    marginLeft: '20px'
  },

}));

export default function NuevoCampeonato() {

  const classes = useStyles()
  return (
    <div>
        <Contenedor/>
        <div align = 'center'>
          <Box
            sx = {{flexGrow: 20}}
            color = 'contrastText'
            backgroundColor = '#D8F3DC'
            mx = {20} //margen a todos los lados
            p = {1} //padding
            borderRadius = '8px'
            border = {2}
          >
            <h1>Nuevo Campeonato</h1>
          </Box>
          <br></br>
          <Box
            sx = {{flexGrow: 20}}
            color = 'contrastText'
            backgroundColor = '#D8F3DC'
            mx = {20} //margen a todos los lados
            p = {1} //padding
            borderRadius = '8px'
            border = {2}
          >
            <Grid container>
              <Grid item sm = {3}>
                <h2 className={classes.text2}>Nombre:</h2>
              </Grid>
              <Grid item sm = {12} xl = {8} marginTop= {'10px'}  >
                  <TextField variant='outlined' fullWidth/>
              </Grid>
              <Grid item sm = {3}>
                <h2 className={classes.text2}>Fecha de inicio:</h2>
              </Grid>
              <Grid item sm = {12} xl = {8} marginTop= {'10px'}  >
                  <TextField variant='outlined' fullWidth/>
              </Grid>
              <Grid item sm = {3}>
                <h2 className={classes.text2}>Fecha de termino:</h2>
              </Grid>
              <Grid item sm = {12} xl = {8} marginTop= {'10px'}  >
                  <TextField variant='outlined' fullWidth/>
              </Grid>
              <br></br>
              <Box 
                margin = 'center' 
                sx = {{flexGrow: 20}}
                marginTop = {'20px'}
              >
                <FormControl>
                    <FormLabel >Categorias</FormLabel>
                  <FormGroup>
                    <Grid item sm = {12} xl = {12} marginTop= {'20px'} >
                      <FormControlLabel
                        label = 'Primera'
                        control = {<Checkbox/>}
                      />
                      <FormControlLabel
                        label = 'Segunda'
                        control = {<Checkbox/>}
                      />
                      <FormControlLabel
                        label = 'Tercera'
                        control = {<Checkbox/>}
                      />
                      <FormControlLabel
                        label = 'Cuarta'
                        control = {<Checkbox/>}
                      />
                      <FormControlLabel
                        label = 'Quinta'
                        control = {<Checkbox/>}
                      />
                      <FormControlLabel
                        label = 'Sexta'
                        control = {<Checkbox/>}
                      />     
                      <FormControlLabel
                        label = 'Damas A'
                        control = {<Checkbox/>}
                      />       
                      <FormControlLabel
                        label = 'Damas B'
                        control = {<Checkbox/>}
                      />
                      <FormControlLabel
                        label = 'Damas C'
                        control = {<Checkbox/>}
                      />
                    </Grid>
                  </FormGroup>
                </FormControl>
              </Box>
            </Grid>
          </Box>

        </div>
    </div>
  )
}
